import React from 'react';

export const Test = () => {
  return (
    <Downshift
   onChange={selection =>
     alert(selection ? `You selected ${selection.value}` : 'Selection Cleared')
   }
   itemToString={item => (item ? item.value : '')}
 >
   {({
     getInputProps,
     getItemProps,
     getLabelProps,
     getMenuProps,
     isOpen,
     inputValue,
     highlightedIndex,
     selectedItem,
     getRootProps,
   }) => (
     <div>
       <label {...getLabelProps()}>What is your favourite color? </label>
       <div
         style={{display: 'inline-block'}}
         {...getRootProps({}, {suppressRefError: true})}
       >
         <input {...getInputProps()} />
       </div>
       <ul {...getMenuProps()}>
         {isOpen
           ? colors
               .filter(item => !inputValue || item.value.includes(inputValue))
               .map((item, index) => (
                 <li
                   {...getItemProps({
                     key: item.value,
                     index,
                     item,
                     style: {
                       backgroundColor:
                         highlightedIndex === index ? 'cyan' : 'white',
                       fontWeight: selectedItem === item ? 'bold' : 'normal',
                     },
                   })}
                 >
                   {item.value}
                 </li>
               ))
           : null}
       </ul>
     </div>
   )}
 </Downshift>
  )
};
